  const {movies} = useContext(MovieContext)

  const renderListMovie = movies.map((movie)=>{
    return(
      <div className="movie-card" key={movie.id}>
        <div>
          <Movie movie={movie}/>
        </div>
      </div>
    )
  })


    return (
    <div>
      <FormSearch/>
      {renderListMovie}
{/*       <Movie/> */}
    </div>
  )
}

